import React, { useState, useEffect } from "react";
import {
  Divider,
  FormControl,
  FormControlLabel,
  FormControlLabelText,
  Heading,
  Link,
  LinkText,
  Text,
  Input,
  InputField,
  VStack,
} from "@gluestack-ui/themed";
import { ActivityIndicator } from "react-native";

const Profile = ({ navigation }) => {
  const [profileData, setProfileData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [errorMessage, setErrorMessage] = useState("");

  const bearerToken =
    "eyJhbGciOiJSUzI1NiIsImtpZCI6IjZDRjFFRTM0Qjc1MkY5QzUzMkJCODhGMTlDNDRBRkFFQTc5Mjc1M0YiLCJ4NXQiOiJiUEh1TkxkUy1jVXl1NGp4bkVTdnJxZVNkVDgiLCJ0eXAiOiJhdCtqd3QifQ..vL4QIJLxaDxSsVqDaxdOnloGFq5LYEuupJii2fa_P9vw9GqpGUFLf99gNr9IrDEH9x-qikTWmqFydaAaQF71KTWNgu33ja5D-64LQg_8ReWVRoRH57fHXls8NNH6g11AqY6QK-oQXx3Iaxq7SNjL8N756Yp_37jJD2kCI54HQJUtYCL5i9hSCuE__JnbBwf0N-ayOVDzlXhtv6gpCR1Pk-7CLrFnCqVB0HWqd_5sszTHrLmGaH12Sspmn82IvcwF0pWnV26hmVyrHTaExpA51YcSH06uQOXJBj8GrDVv7PRCB3EjIjKFKKUpK39K4dYvdu3h5rmSMNqWQ6ZljMU3Ng";
  useEffect(() => {
    const fetchProfile = async () => {
      try {
        const response = await fetch(
          `https://dev-api.waficommerce.com/api/account/my-profile`,
          {
            method: "GET",
            headers: {
              "Content-Type": "application/json",
              Authorization: `Bearer ${bearerToken}`,
            },
          }
        );

        if (!response.ok) {
          throw new Error("Failed to fetch profile data");
        }

        const data = await response.json();
        setProfileData(data);
      } catch (error) {
        setErrorMessage("Failed to load profile data!");
        console.error("Error fetching profile data:", error);
      } finally {
        setLoading(false);
      }
    };

    fetchProfile();
  }, []);

  // const response = await axios.get(
  //   "https://dev-api.waficommerce.com/api/account/my-profile",
  //   {
  //     headers: {
  //       accept: "*/*",
  //       Authorization: `Bearer ${bearerToken}`,
  //       "X-Requested-With": "XMLHttpRequest",
  //     },
  //   }
  // );
  //       setProfileData(response.data);
  //     } catch (error) {
  //       setErrorMessage("Failed to load profile data!");
  //       console.error("Error fetching profile data:", error.response);
  //     } finally {
  //       setLoading(false);
  //     }
  //   };

  //   fetchProfile();
  // }, []);

  if (loading) {
    return <ActivityIndicator size="large" color="#0000ff" />;
  }

  if (errorMessage) {
    return <Text>{errorMessage}</Text>;
  }

  return (
    <VStack p="$4">
      <VStack>
        <Heading color="$text500">My Profile</Heading>

        {/* display username */}
        <Text>{profileData.userName}</Text>
        {/* <FormControl>
          <FormControlLabel>
            <FormControlLabelText>Username</FormControlLabelText>
          </FormControlLabel>
          <Input>
            <InputField value={profileData?.userName || ""} isReadOnly />
          </Input>
        </FormControl> */}

        {/* display email */}
        <FormControl>
          <FormControlLabel>
            <FormControlLabelText>Email</FormControlLabelText>
          </FormControlLabel>
          <Input>
            <InputField value={profileData?.email || ""} isReadOnly />
          </Input>
        </FormControl>

        {/* display phone number */}
        <FormControl>
          <FormControlLabel>
            <FormControlLabelText>Phone Number</FormControlLabelText>
          </FormControlLabel>
          <Input>
            <InputField value={profileData?.phoneNumber || ""} isReadOnly />
          </Input>
        </FormControl>
      </VStack>
      <Divider />
      <Link onPress={() => navigation.navigate("PasswordChange")}>
        <LinkText color="blue">Change Password</LinkText>
      </Link>
    </VStack>
  );
};

export default Profile;
